var title_f0_2_33="Membranous Light";
var content_f0_2_33=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F57841%7ENEPH%2F74698%7ENEPH%2F55226%7ENEPH%2F69629%7ENEPH%2F62937%7ENEPH%2F69348&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F57841%7ENEPH%2F74698%7ENEPH%2F55226%7ENEPH%2F69629%7ENEPH%2F62937%7ENEPH%2F69348&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Light micrograph showing membranous nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 395px; height: 254px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of membranous nephropathy, showing diffuse thickening of the glomerular basement membrane (long arrows) with essentially normal cellularity. Note how the thickness of the glomerular capillary walls is much greater than that of the adjacent tubular basement membranes (short arrow). There are also areas of mesangial expansion (asterisks). Immunofluorescence microscopy (showing granular IgG deposition) and electron microscopy (showing subepithelial deposits) are generally required to confirm the diagnosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a normal glomerulus. There are only 1 or 2 cells per capillary tuft, the capillary lumens are open, the thickness of the glomerular capillary wall (long arrow) is similar to that of the tubular basement membranes (short arrow), and the mesangial cells and mesangial matrix are located in the central or stalk regions of the tuft (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut G Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Immunofluorescence microscopy showing membranous nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 294px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Immunofluorescence microscopy in membranous nephropathy showing diffuse, granular IgG deposition along the capillary walls.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electron micrograph showing membranous nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 391px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph shows stage II membranous nephropathy. Electron dense deposits (D) are present in the subepithelial space across the glomerular basement membrane (GBM) and under the epithelial cells (Ep). New basement membrane is growing between the deposits, leading to a spike appearance on silver stain.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Silver stain in membranous nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 273px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph silver stain of membranous nephropathy shows a spike appearance (arrows). The spikes represent new basement membrane growing between the subepithelial immune deposits which are visible on electron microscopy, but not with this stain.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Stage III membranous nephropathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 256px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in stage III membranous nephropathy. The subepithelial immune deposits (D) have a lucent, moth-eaten appearance and have been incorporated into the glomerular basement membrane (GBM) as new basement membrane has grown around the deposits (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electron micrograph showing membranous lupus nephritis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 234px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of membranous lupus nephritis. The subepithelial immune deposits (D) are characteristic of any form of membranous nephropathy, but the intraendothelial tubuloreticular inclusions (arrow) strongly suggest underlying lupus.",
"    <div class=\"footnotes\">",
"     GBM: glomerular basement membrane; Ep: epithelial cell.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
