var title_f0_2_36="FTT tips for parents PI";
var content_f0_2_36=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F52880&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F52880&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Tips for parents of children who need to gain weight",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Food advice",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children who drink a lot may not eat as much food. At mealtimes, give your child food first. (Drinks are filling and have fewer calories.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Limit juices to 4 to 8 ounces per day. Also limit intake of water and carbonated drinks - give your child milk or formula instead.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Don't worry if your child wants to eat the same food every day. It is more important that he or she gets enough calories and protein.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Junk foods have little protein and fewer calories than some other food choices. Junk foods will not help growth.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Offer foods that are easy for your child to handle (eg, Cheerios&reg;, french fries, slices of banana, or peas).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Add margarine, mayonnaise, gravies, and grated cheese. For snacks, use cheese, pudding, bananas, or dried fruit.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Feeding times",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children need to eat often, but not all the time. Offer something every two to three hours, to allow three meals and two to three snacks a day. Avoid snacks right after an unfinished meal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Children work well with schedules. Try to keep mealtimes and snack times about the same each day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allow one hour without food or drink (except water) before a meal so your child gets hungry.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Do not make mealtime too long for your child. (Fifteen minutes is probably long enough for a toddler.)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Feeding behavior",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Try to relax. Mealtimes should be nice for everyone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Learn how your child acts when he or she is hungry or full. Learn what foods he or she likes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        You can choose what food to feed your child, but your child chooses how much to eat.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Avoid battles over eating. Do not force, bribe, threaten, or punish your child. Instead, praise your child for eating well.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Do not punish your child by not feeding him or her.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allow your child to feed himself or herself. Try very small amounts at first. Offer seconds later. Expect a mess and be ready for easy clean-up (use bibs, newspaper under high chair, etc).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If your baby wants to hold the spoon, use two spoons. Let your baby hold one, and you use the other to feed your baby.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Feeding area",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Try to eat together as a family so that brothers, sisters, and parents can show a young child what good eating behavior is.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Limit things that take your child's attention away from eating, such as television.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Make sure your child can reach the food. (Use a high chair, booster seat, telephone book, or small table.)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Bithoney WG, Dubowitz H, Egan H. Failure to thrive/growth deficiency. Pediatr Rev 1992; 13:453.",
"      </li>",
"      <li>",
"       Frank DA, Zeisel SH. Failure to thrive. Pediatr Clin North Am 1988; 35:1187.",
"      </li>",
"      <li>",
"       Frank D, Silva M, Needlman R. Failure to thrive: Mystery, myth and method. Contemp Pediatr 1993; 10:114.",
"      </li>",
"      <li>",
"       Texas Children's Hospital (www.texaschildrenshospital.org/Parents/TipsArticles/AcrobatDisplay.aspx?fid=145).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
